import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import { Form, Button, DropdownButton, Dropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const FeedbackForm = () => {
  const [feedbackData, setFeedbackData] = useState({
    faculty: '',
    subject: '',
    rating: '',
    comments: ''
  });

  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const feedbackType = queryParams.get('type');

  useEffect(() => {
    setFeedbackData((prevData) => ({
      ...prevData,
      feedbackType: feedbackType || 'Faculty Feedback' // Set default feedback type
    }));
  }, [feedbackType]);

  const handleChange = (e) => {
    setFeedbackData({ ...feedbackData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/x-www-form-urlencoded',
        },
        body: new URLSearchParams({
          faculty: feedbackData.faculty,
          subject: feedbackData.subject,
          rating: feedbackData.rating,
          comments: feedbackData.comments,
        }),
      });

      if (response.ok) {
        alert('Feedback submitted successfully!');
        setFeedbackData({ faculty: '', subject: '', rating: '', comments: '', feedbackType: '' });
      } else {
        throw new Error('Failed to submit feedback');
      }
    } catch (error) {
      console.error('Error submitting feedback:', error);
    }
  };

  return (
    <div className="container mt-5">
      <h2>Submit Feedback</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="faculty">
          <Form.Label>Faculty Name</Form.Label>
          <Form.Control
            type="text"
            name="faculty"
            value={feedbackData.faculty}
            onChange={handleChange}
            required
          />
        </Form.Group>
        <Form.Group controlId="subject">
          <Form.Label>Subject</Form.Label>
          <Form.Control
            type="text"
            name="subject"
            value={feedbackData.subject}
            onChange={handleChange}
            required
          />
        </Form.Group>
        <Form.Group controlId="rating">
          <Form.Label>Rating</Form.Label>
          <Form.Control
            as="select"
            name="rating"
            value={feedbackData.rating}
            onChange={handleChange}
            required
          >
            <option value="">Select a Rating</option>
            <option value="1">1</option>
            <option value="2">2</option>
            <option value="3">3</option>
            <option value="4">4</option>
            <option value="5">5</option>
          </Form.Control>
        </Form.Group>
        <Form.Group controlId="comments">
          <Form.Label>Comments</Form.Label>
          <Form.Control
            as="textarea"
            name="comments"
            value={feedbackData.comments}
            onChange={handleChange}
            rows={3}
            required
          />
        </Form.Group>
        <Form.Group controlId="feedbackType">
          <Form.Label>Feedback Type</Form.Label>
          <DropdownButton
            id="dropdown-feedback-type"
            title={feedbackData.feedbackType || "Select Feedback Type"}
            onSelect={(eventKey) => setFeedbackData({ ...feedbackData, feedbackType: eventKey })}
          >
            <Dropdown.Item eventKey="Faculty Feedback">Faculty Feedback</Dropdown.Item>
            <Dropdown.Item eventKey="Top Rated Faculty">Top Rated Faculty</Dropdown.Item>
            <Dropdown.Item eventKey="Visual Representation">Visual Representation</Dropdown.Item>
          </DropdownButton>
        </Form.Group>
        <Button variant="primary" type="submit">Submit</Button>
      </Form>
    </div>
  );
};

export default FeedbackForm;
